import React from 'react'
import logo from "../Assets/logo.png"
import {FaBars, FaTimes} from "react"

function Nav() {
  return (
    <div className="fixed w-full h-[70px] flex justify-between bg-[#FDE74C]">
      <div>
        <img src={logo} alt="Logo image" />
      </div>

    </div>
  )
}

export default Nav
